import data, { NO_PROJECT } from "../data/data"
import Project from "../components/Project"
import 'bootstrap/dist/css/bootstrap.min.css';
import '../styles/styles.css';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Nav from 'react-bootstrap/Nav';

const projectType = (project) => {
    if (project == NO_PROJECT) {
        return true
    }
    return false
}

const projects = () => {
    const projects = []
    const noprojects = []

    Object.keys(data).map ((project, idx) => {
        if (project != NO_PROJECT) {
            projects.push(<NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>)
                        //<Project key={idx} project={project} notes={data[project]}/>)
                        //console.log("notes: ", data[project]);
        } else {
            return <Project key={idx} project={project} notes={data[project]}/>;
        }

    })
}

const App = () =>{
    // <p>Components go here</p>
    return ( <div>
                <Navbar bg="light" expand="lg">
                    <Navbar.Brand>Notes</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                            <NavDropdown title="Projects" id="basic-nav-dropdown">
                                {}
                                <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                                <NavDropdown.Divider />
                                <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                            </NavDropdown>
                            <Nav.Link href="#features">No Projects</Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                </Navbar>
                <div>
                {
                    Object.keys(data).map ((project, idx) => 
                        <Project key={idx} project={project} notes={data[project]}/>
                        //console.log("notes: ", data[project]);

                    )

                }
                </div>
            </div>
    )
}


export default App;
